export default (function(a,b,c,d){return {data:{fksS0xSFel:{data:{id:2778,attributes:{imdbId:"tt7556122",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BNDJiZDliZDAtMjc5Yy00MzVhLThkY2MtNDYwNTQ2ZTM5MDcxXkEyXkFqcGdeQXVyMDA4NzMyOA@@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"6.6\u002F10"},{Source:"Rotten Tomatoes",Value:"80%"},{Source:"Metacritic",Value:"70\u002F100"}],item_lang:{data:{id:3445,attributes:{title:"The Old Guard",plot:"Led by a warrior named Andy (Charlize Theron), a covert group of tight-knit mercenaries with a mysterious inability to die have fought to protect the mortal world for centuries. But when the team is recruited to take on an emergency mission and their extraordinary abilities are suddenly exposed, it's up to Andy and Nile (Kiki Layne), the newest soldier to join their ranks, to help the group eliminate the threat of those who seek to replicate and monetize their power by any means necessary.",slug:"the-old-guard"}}},books:{data:[{id:13200,attributes:{title:"The Old Guard: Force Multiplied #1 (of 5)",description:"Soon to be a major motion picture starring CHARLIZE THERON and KIKI LAYNE! Andromache of Scythia and her band of soldiers are back in this second story chronicling the battles and burdens of their dubious immortality. Nile's addition to the team has given them new purpose and new direction, but when you've got 6,000 years of history at your back, the past is always ready to return with a vengeance. Written by GREG RUCKA and illustrated by the incomparable LEANDRO FERNéNDEZ, with colors by DANIELA MIWA, lettering by JODI WYNNE, and design by ERIC TRAUTMANN, the highly anticipated return of THE OLD GUARD is finally here! HOLLYWOOD NEWS! 12 Years a Slave star Chiwetel Ejiofor has signed on for the Netflix and Skydance adaptation of THE OLD GUARD, alongside co-star Charlize Theron who also produces. Harry Melling (The Ballad of Buster Scruggs), Veronica Ngo (Star Wars: The Last Jedi), KiKi Layne, Marwan Kenzari, Matthias Schoenaerts, and Luca Marinelli have all been previously announced as cast in the upcoming movie.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=F1PBDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:true,published:"2019-12-18",publisher:d,subtitle:a}},{id:13201,attributes:{title:"The Old Guard Book Two: Force Multiplied",description:"Six-thousand-year-old Andromache \"Andy\" of Scythia, Nicolo \"Nicky\" of Genoa, Yusuf \"Joe\" al-Kaysani, and twenty-seven-year-old Nile return to the fight in the critically acclaimed miniseries by New York Times bestselling creators GREG RUCKA and LEANDRO FERNANDEZ! When you've waged war as long as Andy and her squad, you've gotten your hands more than bloody. Now, the day has come to confront the sins of the past. But as Nile struggles to make peace with the team, the last person Andy expected to ever see again returns to challenge not only what Andy believes in, but what the team is willing to fight for. Collects THE OLD GUARD: FORCE MULTIPLIED #1-5",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=uQzkwgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:c,published:"2020-06-23",publisher:a,subtitle:a}},{id:13202,attributes:{title:"The Old Guard Book One",description:"\"Contains material previously published as The old guard #1-#5\"--Indicia.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=G4d3swEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:c,published:"2017-08-29",publisher:a,subtitle:"Opening Fire"}},{id:13203,attributes:{title:"The old guard",description:a,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=mZIczgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b,"Leandro Fernández"],firstBook:c,published:"2020-01-01",publisher:a,subtitle:a}},{id:13204,attributes:{title:"The Old Guard Book One: Opening Fire",description:"Collecting the critically acclaimed miniseries by GREG RUCKA and LEANDRO FERNANDEZ. Old soldiers never dieand some of them donÍt even fade away. Cursed with immortality, Andromache of Scythia and her comrades-in-arms ply their trade for those who can findand affordtheir services. But in the 21st century, being immortal is a difficult secret to keep, and when you live long enough, you learn that there are many fates far worse than death. Collects THE OLD GUARD #1-5",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=azkxDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:c,published:"2017-08-30",publisher:d,subtitle:a}}]}}},meta:{}}},prerenderedAt:1680940900070}}("","Greg Rucka",false,"Image Comics"))